@deterministic
def chunks(l):
    """Divide a list of nodes `l` in `n` chunks"""
    n=int(len(l)/2)
    l_c = iter(l)
    while 1:
        x = tuple(itertools.islice(l_c, n))
        if not x:
            return
        return x
      
      
